  <style>
    body { background:#111; color:#fff; font-family:sans-serif; margin:0; padding:0; }
    h1 { text-align:center; padding:20px; color:#ff4dff; }
    .container { display:grid; grid-template-columns:repeat(auto-fit,minmax(250px,1fr)); gap:20px; padding:20px; }
    .card { background:#222; border-radius:10px; padding:15px; text-align:center; }
    .card img { max-width:100%; border-radius:8px; }
    .btn { margin:5px; padding:10px 15px; border:none; border-radius:5px; cursor:pointer; }
    .add { background:#444; color:#fff; }
    .buy { background:magenta; color:#fff; }
    #cart-icon { position:fixed; top:15px; right:15px; cursor:pointer; background:#ff4dff; padding:10px; border-radius:50%; }
    #cart, #checkout { background:#222; margin:20px; padding:20px; border-radius:10px; }
    input, select { width:100%; padding:10px; margin:5px 0; border-radius:5px; border:none; }
    label { display:block; margin-top:10px; }
    #payment-element { margin-top:20px; }
    #card-errors { color:red; margin-top:10px; }
    #completeOrder { background:limegreen; color:#fff; padding:15px; border:none; border-radius:5px; margin-top:20px; cursor:pointer; }
  </style>

      <h2>Glow-in-the-Dark</h2>
      <p>$6–$26</p>
      <button class="btn add" onclick="addToCart('Glow-in-the-Dark')">Add to Cart</button>
      <button class="btn buy" onclick="buyNow('Glow-in-the-Dark')">Buy Now</button>
    </div>
    
  </div>

  <div id="cart">
    <h2>Your Cart</h2>
    <ul id="cartItems"></ul>
    <p><b>Total:</b> $<span id="cartTotal">0.00</span></p>
  </div>

  <div id="checkout">
    <h2>Checkout</h2>
    <form id="payment-form">
      <label>Name</label>
      <input id="name" required>
      <label>Email</label>
      <input id="email" type="email" required>
      <label>Phone</label>
      <input id="phone">

      <label>Bracelet Size</label>
      <select id="size">
        <option value="26">XXXS – 3.5 in ($26)</option>
        <option value="12">XXS – 4 in ($12)</option>
        <option value="7">XS – 4.5 in ($7)</option>
        <option value="6">S – 5 in ($6)</option>
        <option value="9">M – 6.5 in ($9)</option>
        <option value="10">L – 8.5 in ($10)</option>
        <option value="15">XL – 10 in ($15)</option>
        <option value="19">XXL – 12.5 in ($19)</option>
        <option value="26">XXXL – 14 in ($26)</option>
      </select>

      <label>Shipping Address</label>
      <input id="address" placeholder="Street address" required>
      <input id="city" placeholder="City" required>
      <input id="state" placeholder="State">
      <input id="zip" placeholder="Postal Code" required>
      <input id="country" placeholder="Country" required>

      <label>Shipping Option</label>
      <select id="shipping">
        <option value="9">Ground Advantage – $9</option>
        <option value="13">Priority Mail – $13</option>
        <option value="25">Priority Express – $25</option>
        <option value="47">First Class Intl – $47</option>
        <option value="78">Priority Intl – $78</option>
      </select>

      <label>Processing</label>
      <select id="processing">
        <option value="0.5">Charmers 24 Hour Processing – $0.50</option>
        <option value="0">Charmers Seven Day Processing – Free</option>
      </select>

      <div id="payment-element"></div>
      <div id="card-errors"></div>
      <label><input type="checkbox" id="tos"> By buying from Charmers you agree to our ToS</label>
      <div class="g-recaptcha" data-sitekey="6LeT6JArAAAAAKZDUSTu8Krw6i1sQshZnbgMoLvO"></div>

      <button id="completeOrder">Complete Order</button>
    </form>
  </div>

<script>
let cart = [];
function addToCart(name) {
  cart.push(name);
  renderCart();
}
function buyNow(name) {
  cart = [name];
  renderCart();
  document.getElementById('checkout').scrollIntoView();
}
function renderCart() {
  let items = document.getElementById('cartItems');
  items.innerHTML = "";
  cart.forEach(p => {
    let li = document.createElement('li');
    li.textContent = p;
    items.appendChild(li);
  });
  document.getElementById('cartCount').textContent = cart.length;
  let sizePrice = parseFloat(document.getElementById('size')?.value || 0);
  document.getElementById('cartTotal').textContent = (sizePrice*cart.length).toFixed(2);
}

const stripe = Stripe("pk_live_51ReQgoHwN7YkNv6zwRaz8N1GO0PL7Bb3pqUbcxhss5cQQpJFKjoiNJR4DWKeTRWwhw2tmejOtXjbnrIg6sHnhxc600ePIEIgBc");
let elements;

initialize();
document.getElementById("payment-form").addEventListener("submit", handleSubmit);

async function initialize() {
  try {
    const response = await fetch("https://charmerspay.onrender.com/create-payment-intent", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ items: cart })
    });
    const data = await response.json();
    if (!data.clientSecret) throw new Error("No client secret returned");

    elements = stripe.elements({ clientSecret: data.clientSecret });
    const paymentElement = elements.create("payment");
    paymentElement.mount("#payment-element");
  } catch (err) {
    document.getElementById("card-errors").textContent = "⚠️ Failed to load payment form: " + err.message;
  }
}

async function handleSubmit(e) {
  e.preventDefault();
  if(!document.getElementById("tos").checked) {
    alert("You must accept ToS");
    return;
  }
  if (grecaptcha.getResponse().length === 0) {
    alert("Please complete the reCAPTCHA");
    return;
  }
  const { error } = await stripe.confirmPayment({
    elements,
    confirmParams: {
      return_url: window.location.href
    }
  });
  if (error) {
    document.getElementById("card-errors").textContent = error.message;
  } else {
    alert("✅ Payment processed successfully!");
  }
}
</script>
